control.onControlLoad:
//鼠标点击行激活处理
g5.userId = null;
g5.tableClick = function(sender) {
    var c, x, y;
    for (y = 0; y < g5.pageSize; y++) {
        for (x = 0; x < 3; x++) {
            c = ee.getTableCell(ee.getControl("tablebody2"), x, y);
            c.style.backgroundColor = "";    
        }
    }
    for (x = 0; x < 3; x++) {
        c = ee.getTableCell(ee.getControl("tablebody2"), x, sender.rowIndex);
        c.style.backgroundColor = "#E0EEFF";
    }
    if (eb.isEmpty(g5.dataset1)) {
        g5.userId = null;
        return;
    }
    g5.id = parseInt(g5.dataset1.getData(0, sender.rowIndex));
    g5.code1 = g5.dataset1.getData(1, sender.rowIndex);
    g5.code2 = g5.dataset1.getData(2, sender.rowIndex);
    if (sender.rowIndex < g5.dataset1.rowCount) {
        query2();
    } else {
        g5.dataset2 = new EDataSet();
        g5.pageCount2 = 1;
        g5.pageCurrent2 = 1;
        ee.setTableData(ee.getControl("tablebody1"), g5.dataset2,0);   
        ee.setText(ee.getControl("layoutxitem6"), g5.pageCurrent2 + "/" + g5.pageCount2);
        ee.setText(ee.getControl("panel35"), "共找到" +
            "<font color = '#d00000'>" + g5.pageRecordCount2 + "条</font>记录");
        ee.setAutoScroll(ee.getControl("layoutyitem4"), false);   
        setTimeout(function () { ee.setAutoScroll(ee.getControl("layoutyitem4"), true)}, 100); 
    }
}
g5.code3 = "";
g5.tableClick2 = function(sender) {
    var c, x, y;
    for (y = 0; y < g5.pageSize2; y++) {
        for (x = 0; x < 3; x++) {
            c = ee.getTableCell(ee.getControl("tablebody1"), x, y);
            c.style.backgroundColor = "";    
        }
    }
    for (x = 0; x < 3; x++) {
        c = ee.getTableCell(ee.getControl("tablebody1"), x, sender.rowIndex);
        c.style.backgroundColor = "#E0EEFF";
    }
    if (eb.isEmpty(g5.dataset2)) {
        g5.code3 = "";
        return;
    }
    g5.code3 = g5.dataset2.getData(1, sender.rowIndex);
}



//分页处理
g5.pageSize = 15;
g5.pageCurrent = 1;
g5.pageCount = 1;
g5.pageJump = function (pageNumber) {
    if (pageNumber < 1) pageNumber = 1;
    if (pageNumber > g5.pageCount) {
        pageNumber = g5.pageCount;
    }
    if (g5.pageCurrent != pageNumber) {
        g5.pageCurrent = pageNumber;
        if (g5.pageCurrent > 0) {
            query();
        }
    }
}
g5.pageSize2 = 15;
g5.pageCurrent2 = 1;
g5.pageCount2 = 1;
g5.pageJump2 = function (pageNumber) {
    if (pageNumber < 1) pageNumber = 1;
    if (pageNumber > g5.pageCount2) {
        pageNumber = g5.pageCount2;
    }
    if (g5.pageCurrent2 != pageNumber) {
        g5.pageCurrent2 = pageNumber;
        if (g5.pageCurrent2 > 0) {
            query2();
        }
    }
}

query();

