    eio.appendString8("F");
    eio.appendString8("token失效");
    es.logWarning("用户token失效, sql=" + sql);
    return;
}   
var userId = db.getString(sqlResult, "id");
var companyId = db.getString(sqlResult, "companyId");

//获取记录数量
sql =
    "SELECT count(*) as c " +
    "FROM userRights " +
    "WHERE ([status] <> 'DEL') and dbo.userRights.rightsType = 'if' ";
sqlResult = db.executeQuery("DB", sql);   
db.read(sqlResult);
var count = db.getInt32(sqlResult, "c");

sql= 
    "SELECT   T1.id, T1.regDatetime, T1.name, T1.note, dbo.userRights.status AS rightsStatus, dbo.userRights.name AS rightsName, " +
    "    dbo.userRights.note AS rightsNote " +
    "FROM      (SELECT   id, regDatetime, status, name, rightsName, note " +
    "            FROM      dbo.userType " +
    "            WHERE   (name = '" + db.encode(userType) + "')) AS T1 RIGHT OUTER JOIN " +
    "    dbo.userRights ON T1.rightsName = dbo.userRights.name " + 
    "where dbo.userRights.status <> 'DEL'  and dbo.userRights.rightsType = 'if' " +
    "order by rightsName;";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
eio.appendString8("T");
eio.appendInt32(count);
eio.appendDataSet(sqlResult,"name,rightsName,rightsNote", pageSize*(pageCurrent-1), pageSize);

